angular.element(document).ready(function(){angular.forEach("table.oiz-patient-results",function(n){var t=angular.element(n).scope();t.search=t.search||{};t.search.query=t.search.query||{};t.search.results=null;t.search.pageSize=t.search.pageSize||10;t.search.next=t.search.next||function(){OpenIZ.Patient.findAsync({query:t.search.query,offset:t.search.results.offset+t.search.pageSize,count:t.search.pageSize,continueWith:function(n){t.search.results=n.all("Patient");t.$apply()},onException:function(n){OpenIZ.App.toast(n.message)}})};t.search.previous=t.search.previous||function(){OpenIZ.Patient.findAsync({query:t.search.query,offset:t.search.results.offset-t.search.pageSize,count:t.search.pageSize,continueWith:function(n){t.search.results=n.all("Patient");t.$apply()},onException:function(n){OpenIZ.App.toast(n.message)}})};t.search.goPage=t.search.goPage||function(n){OpenIZ.Patient.findAsync({query:t.search.query,offset:n*t.search.pageSize,count:t.search.pageSize,continueWith:function(n){t.search.results=n.all("Patient");t.$apply()},onException:function(n){OpenIZ.App.toast(n.message)}})}})});